window.bookSummaryJSON = "<p><b>Discover and rediscover the world of the Queen's Thief, from the acclaimed series launch&nbsp;</b><b><i>The Thief</i></b><b> to the thrilling, 20-years-in-the-making conclusion,&nbsp;</b><b><i>The Return of the Thief</i></b><b>. </b></p> <p><i>Thick as Thieves</i> is the fifth novel set in the world of the Queen's Thief. <i>New York Times</i> best-selling author Megan Whalen Turner's entrancing and award-winning Queen's Thief novels bring to life the world of the epics and feature one of the most charismatic and incorrigible characters of fiction, Eugenides the thief. Megan Whalen Turner's Queen's Thief novels are rich with political machinations and intrigue, battles lost and won, dangerous journeys, divine intervention, power, passion, revenge, and deception. Perfect for fans of Leigh Bardugo, Marie Lu, Patrick Rothfuss, and George R. R. Martin.&nbsp;</p> <p>Kamet, a secretary and slave to his Mede master, has the ambition and the means to become one of the most powerful people in the Empire. But with a whispered warning the future he envisioned is wrenched away, and he is forced onto a very different path. Set in the world of the Queen's Thief, this epic adventure sees an ordinary hero take on an extraordinary mission. The Queen's Thief novels have been praised by writers, critics, reviewers, and fans, and have been honored with glowing reviews, \"best of\" citations, and numerous awards, including the <i>Los Angeles Times</i> Book Prize, a Newbery Honor, the Andre Norton Award shortlist, and the Mythopoeic Fantasy Award.</p>"; 
